/**
 * 3. Longest Substring Without Repeating Characters
 * - Given a string s, find the length of the
 * longest substring without repeating characters
 *
 * - Example 1
 * + s = "abcabcbb"
 * + output = 3
 * + Explanation: The answer is "abc",
 * with the length of 3.
 *
 * - Example 2
 * + s = "bbbbb"
 * + output = 1
 * + Explanation: The answer is "b",
 * with the length of 1.
 *
 * - Example 3
 * + s = "pwwkew"
 * + output: 3
 * + Explanation: The answer is "wke", with the length of 3.
 * Notice that the answer must be a substring, "pwke" is a
 * subsequence and not a substring.
 *
 *
 * Constraints
 * + 0 <= s.length <= 5 x 10^4
 * + s consists of English letter, digits, symbols and spaces.
 *
 *
 *
 */

/**
 *
 * @param {string} subString
 * @param {string} character
 */
function wasCharacterExist(subString, character) {
  /**
   * + subString = "abc"
   * + character = b
   * + result = true
   *
   * + subString = "abc"
   * + character = d
   * + result = false
   */
  let result = false;

  for (let i = subString.length - 1; i >= 0; --i) {
    if (subString[i] === character) {
      result = true;
      break;
    }
  }

  return result;
}

/**
 *
 * @param {Array} a
 */
function getArrayMaxNumber(a) {
  /**
   * -------0 1 2 3
   * + a = [1,2,3,4]
   * + result = 4
   *
   * + max = -infinity
   * + i: a.length - 1 -> 0
   *   + if a[i] > max
   *     + max = a[i]
   *
   */
  let max = 1;

  for (let i = a.length - 1; i >= 0; --i) {
    if (a[i] > max) {
      max = a[i];
    }
  }

  return max;
}

/**
 *
 * @param {Number} max
 * @param {Array} arraySubString
 * @param {String} defaultString
 *
 *
 */
function getInfoSubStringMax(max, arraySubString, defaultString) {
  const info = [];

  for (let i = 0; i <= arraySubString.length - 1; i++) {
    if (arraySubString[i].length === max) {
      info.push({
        defaultString: defaultString,
        length: max,
        info: arraySubString[i],
      });
    }
  }

  return info;
}

/**
 * @param {string} s
 * @return {number}
 */
const lengthOfLongestSubstring = function (s) {
  /**
   * -------01234567
   * + s = "abcabcbb"
   * + result = 3
   * + "abc" = 3
   *
   * + i: 0 -> length - 1 - 1
   *   + subString = s[i]
   *   + j: i + 1 -> length - 1
   *
   *     + subString += s[j]
   */
  if (s.length === 0) {
    return 0;
  }

  const length = s.length;
  const delta1 = length - 1 - 1;
  const delta2 = length - 1;
  const arraySubString = [];

  for (let i = 0; i <= delta1; ++i) {
    let subString = s[i];
    for (let j = i + 1; j <= delta2; j++) {
      if (wasCharacterExist(subString, s[j])) {
        break;
      }
      subString += s[j];
      arraySubString.push(subString);
    }
  }

  if (arraySubString.length === 0) {
    arraySubString.push(s[0]);
  }

  const arraySubStringLength = [];
  const delta3 = arraySubString.length - 1;

  for (let i = 0; i <= delta3; ++i) {
    arraySubStringLength.push(arraySubString[i].length);
  }
  const max = getArrayMaxNumber(arraySubStringLength);

  const info = getInfoSubStringMax(max, arraySubString, s);
  console.log(info);

  return max;
};

